HORIZONS is a complete elementary French program that makes learning French easier through its step-by-step skill-building methodology, flexible and accessible approach to grammar and new vocabulary, and creative yet sophisticated coverage of Francophone culture. Through varied interactive activities and clear grammar explanations, the text helps you communicate effectively in French while culturally connecting you to he Francophone world. HORIZONS features a clear, easy-to-follow structure that carefully guides you, Competence by Competence, through your first year of elementary French.
